import styled from "styled-components";

const Section = styled.section`
  width: 100vw;
  background-color: ${(props) => props.theme.body};
`;
function Navigation() {
  return (
    <Section>
      <NavBar></NavBar>
    </Section>
  );
}

export default Navigation;
